response.about:
я хочу поддерживать женщин в их желании быть успешными, оставаясь при этом в гармонии, любви и доверии с собой и окружающим миром.

Мне нравятся люди, которые:

- берут ответственность за свою жизнь;
- верят в себя, верят в свой потенциал, верят в свою мечту, поддерживают других людей;
- по настоящему увлечены тем делом, которым они заняты и получают от него удовольствие;
- склонны к творческому подходу, гибкости в отношениях, целеустремлённости;
- могут бросить себе вызов, и добиваться больших результатов;
- создают для других людей что-то, что делает жизнь этих людей лучше;
- получают удовольствие от жизни;

Я не могу понять людей, которые:

-склонны винить в своих неудачах окружающих;
- считают, что они знают «всё», и им не чему больше учиться;
- являются отъявленными спорщиками;
- пытаются всячески доказать своё превосходство;
- находят жизнь скучной и не интересной.

нагло слизано с сайта Станислава Гринберга:))
но очччень созвучно моему мироощущению
